package pt.com.everis.academia.java;

public class ValueOf {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(Boolean.valueOf(true));
		System.out.println(Boolean.valueOf("true"));
		System.out.println(Byte.valueOf("55"));
		System.out.println(Byte.valueOf((byte)55));
		System.out.println(Short.valueOf("1ff", 16));
		System.out.println();
		System.out.println();
		System.out.println();
		System.out.println();
		

	}

}
